// @mui material components
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Typography from "@mui/material/Typography";

// Material Dashboard 2 React components
import Box from "@mui/material/Box";

// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";

import axios from "axios";

import { useEffect, useState } from "react";
import { Divider } from "@mui/material";

import * as React from "react";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";

function ListAllEntries() {
  const [data, setData] = useState([]);
  async function fetchData() {
    const result = await axios.get("http://localhost:9001/entries/all");
    console.log(result.data);
    setData(result.data);
  }

  if (result.status == 200) {
    // Axios parsed response already
    // const data = JSON.parse(response.data);
    console.log(response.data);
    var tableContent = document.querySelector('#roomtype_table > tbody');
    // response.data is the complete parsed reasponse
    // from the server.
    // Inside there is a member "data" again:
    response.data.data.forEach(instance => {
        const row = document.createElement('tr');
        tableContent.appendChild(row);
        for (let key in instance) {
            const cell = document.createElement('td');
            cell.innerText = instance[key];
            row.appendChild(cell);
        };
    });
}

  useEffect(() => {
    fetchData();
  }, []);
  return (
    <DashboardLayout>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Card>
            <Box
              sx={{
                p: 3,
                display: "flex",
                alignItems: "center",
              }}
            >
              <Typography variant="h5" sx={{ flexGrow: 1 }}>
                List All Entries
              </Typography>
            </Box>
            <Divider />
            <Box sx={{ p: 3 }}>
              <TableContainer component={Paper}>
                <Table sx={{ minWidth: 650 }} aria-label="simple table">
                  <TableHead>
                    <TableRow>
                      <TableCell>Entry ID</TableCell>
                      <TableCell align="right">Entry Name</TableCell>
                      <TableCell align="right">Entry Date</TableCell>
                      <TableCell align="right">Entry Time</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {data.map((row) => (
                      <TableRow
                        key={row.entry_id}
                        sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                      >
                        <TableCell component="th" scope="row">
                          {row.entry_id}
                        </TableCell>
                        <TableCell align="right">{row.entry_name}</TableCell>
                        <TableCell align="right">{row.created_at}</TableCell>
                        <TableCell align="right">{row.updated_at}</TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            </Box>
          </Card>
        </Grid>
      </Grid>
    </DashboardLayout>
  );
}
export default ListAllEntries;
